import React from "react";

function Footer() {
  return (
    <footer style={{
      background: "#232323",
      padding: "1rem 0",
      textAlign: "center",
      color: "#bdbdbd"
    }}>
      <div className="container">
        &copy; {new Date().getFullYear()} MovieBooking. All rights reserved.
      </div>
    </footer>
  );
}

export default Footer;
